import React, { Component } from 'react'

 class ClassClick extends Component {
    
    clickHandler() {
        console.log('class clicked button')
    }
    render() {
        return (
            <div>
               <button onClick={this.clickHandler}>
                   click me
                   </button> 
            </div>
        )
    }
}

export default ClassClick
